function capitalizeFirstLetters(string) {
    let splitArray = string.split(' ')
    let upperCase = []
    splitArray.forEach(element=> {
        upperCase.push(element[0].toUpperCase() + element.substring(1))
    })
    
    return upperCase.join(' ')
    
}


